import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButton } from '@ionic/react';

const App = () => (
  <IonPage>
    <IonHeader>
      <IonToolbar>
        <IonTitle>Ionic React App</IonTitle>
      </IonToolbar>
    </IonHeader>
    <IonContent>
      <div className="ion-padding">
        <p>Bem-vindo ao Ionic React!</p>
        <IonButton expand="full" color="primary">Clique em Mim</IonButton>
      </div>
    </IonContent>
  </IonPage>
);

export default App;
